import React from 'react';
import './Layout.css';
import logo from './logo.png';


export default class Layout extends React.Component {

    constructor() {
        super();
        this.state = {
            title: "Hello World",
        };
    }
    
    
    render() {
        return (
            <body className="App-header">
                <div>
                    <img src={logo} className="Logo" />
                    <div className="Conten">
                        <h1> asas </h1>
                        <h1> sfg </h1>
                        <h1> ghgf </h1>
                    </div>

                    
                </div>
            </body>

        );
    };

}
